import React from 'react';
import { Link } from "react-router-dom";
import "../styles/Introduction.css";


function Home() {
    return (
        <div className='introduction'>
            <h1 class="heading">Welcome to Arthmate</h1>
            <p class="paragraph">Arthmate is a B2B fintech that provides solutions for credit risk, technology and data sciences. Arthmate services its embedded fintech platform through its in-house NBFC and co-lending partners. It is also building India's premier P2P platform that will provide HNIs with the choice to invest in a basket of diversified risk pools already underwritten by India's meta risk engine. Arthmate has 40 active competitors and it ranks 11th among them.
12 of its competitors are funded while 6 have exited.
Overall, Arthmate and its competitors have raised over $133M in funding across 24 funding rounds involving 202 investors.
There are no private Unicorns in the entire competition set. Ranjan Kant, Co-Founder & President, is a founder of 1 company and an Angel investor in 1 company. 2 email.
Kumar Vihaan, Co-Founder, is a founder of 1 company and on the board of 1 company.
Harshita Chandra, Director, is on the board of 2 companies and the founder of 1 company.
Naveen Giri, Director, is on the board of 2 companies and the founder of 1 company.
Vishesh Kumar, Director, is on the board of 1 company.</p>

        </div>
    );
}

export default Home;
